import React, { useState } from "react"

interface IState{
    user:{
        email:string,
        password:string
    }
}

const Login: React.FC = () => {

    const [state, setState] = useState<IState>({
        user:{
            email:'',
            password:''
        }
    });

    return (
        <>
            <div className="container">
                <div className="w-50">
                    <form className="card p-4 mt-4">
                        <h1>Login Form Example</h1>
                        <div className="mb-3">
                            <label htmlFor="exampleInputEmail1" className="form-label">Email address</label>
                            <input type="email" name="email" value={state.user.email} className="form-control" id="exampleInputEmail1" aria-describedby="emailHelp" />
                        </div>
                        <div className="mb-3">
                            <label htmlFor="exampleInputPassword1" className="form-label">Password</label>
                            <input type="password" name="password" value={state.user.password} className="form-control" id="exampleInputPassword1" />
                        </div>
                        <button type="submit" className="btn btn-primary">Submit</button>
                    </form>
                    <div className="mt-4 bg-light">
                        <p>input data</p>
                    </div>
                </div>
            </div>
        </>
    )
}

export default Login
